import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on "Your Profile" link
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take screenshot after clicking profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_clicked.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || null;
      const fullName = document.querySelector('h2')?.textContent || null;
      const email = "jun@example.com"; // Hardcoded as per provided data
      const joinDate = "2020-03-15"; // Hardcoded as per provided data
      return { username, fullName, email, joinDate };
    });

    return {
      success: true,
      action: "Profile information harvested successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
